import React, { Component } from 'react';
import { Text, View, Button, TextInput } from 'react-native';


class LoginScreen extends Component{
    
  
  render(){

    const navigation = this.props.navigation;
    return(
      
        <View>
          <Text>Enter Your Email and Password To Log In</Text>

          <Text for="Email"><b></b></Text>
    <TextInput type="text" placeholder="Enter Email:" name="Email" required />

    
    <Text for="Password"><b></b></Text>
    <TextInput secureTextEntry={toggle} type="text" placeholder="Enter Password:" name="Password" required />

        
        <Button
            title="Log In"
            onPress={() => this.props.navigation.navigate('Main')} />

        <Button
            title="Sign Up"
            onPress={() => this.props.navigation.navigate('Signup')} />
        </View>
    );
  }
}

export default LoginScreen;
